.bcn_social-list {
    display: flex;
    flex-direction: column;
    -webkit-box-align: center;
    align-items: center;
    margin: 0px;
    padding: 0px;
    list-style: none;
}
.bcn_social-list li {
margin-top:10px;
    transition:ease-out all 1s;
}
.bcn_social-list li img {
    width:23px;
}
.bcn_social-list::after {
    content: "";
    display: block;
    width: 1px;
    height: 90px;
    margin: 0px auto;
    background-color: #8892b2;
}
.bcn_social-list li:hover
{
  position:relative;
  top:-5px;
  transition:ease-out all 1s;
}
.bcn_social-bottom-container {
    width: 40px;
    position: fixed;
    bottom: 0px;
    right: 40px;
    z-index: 10;
    color: #8892b2;
}
